  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Carolina Sandhills
  National Wildlife Refuge summarizes refuge activities for fiscal year 1974. The
  report begins with a summary of weather and habitat conditions during the period.
  Wildlife including migratory birds, upland game birds, big game animals, fish, and
  furbearers is also covered. A refuge development and maintenance section covers
  physical development, farming activities, and fires. A resource management section
  discusses grazing, fur harvest, and forestry. A public relations section outlines
  recreational use, refuge visitation, and safety. Items of interest are provided
  at the end of the report\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
